We’ve got fun and games for sure! 

Yoga fun and games…definitely 💫😉

This is most of our 300H YTT cohort @innerpeaceyogaschool ☮️ it’s graduation weekend and I have been in awe watching their class videos and practicing together during their final classes…my feelings are beyond words, but I would say grateful is the predominant feeling. I feel grateful to witness and facilitate growth and learning that truly runs both ways—i learn and grow too.

Each of these people shine so bright and facilitate and share yoga classes and workshops to help people experience the harmony of the body, mind, and heart.

Keep an eye on these yoga teachers and their classes for sure. 

